// Constants.
const MAX_LAST_LAYER_LOG_DEGREE_BOUND = 15;
const MAX_FRI_LAYERS = 15;
const MAX_FRI_STEP = 4;

// Configuration for the FRI component.
struct FriConfig {
    // Log2 of the size of the input layer to FRI.
    log_input_size: felt,
    // Number of layers in the FRI. Inner + last layer.
    n_layers: felt,
    // Array of size n_layers - 1, each entry is a configuration of a table commitment for the
    // corresponding inner layer.
    inner_layers: TableCommitmentConfig*,
    // Array of size n_layers, each entry represents the FRI step size,
    // i.e. the number of FRI-foldings between layer i and i+1.
    fri_step_sizes: felt*,
    log_last_layer_degree_bound: felt,
}

func fri_config_validate{range_check_ptr}(
    config: FriConfig*, log_n_cosets: felt, n_verifier_friendly_commitment_layers: felt
) -> (log_expected_degree: felt) {
    assert_nn_le(config.log_last_layer_degree_bound, MAX_LAST_LAYER_LOG_DEGREE_BOUND);
    assert_in_range(config.n_layers, 2, MAX_FRI_LAYERS + 1);
    assert config.fri_step_sizes[0] = 0;
    let (sum_of_step_sizes) = fri_layers_config_validate(
        n_layers=config.n_layers - 1,
        layers=config.inner_layers,
        fri_step_sizes=&config.fri_step_sizes[1],
        log_input_size=config.log_input_size - config.fri_step_sizes[0],
        n_verifier_friendly_commitment_layers=n_verifier_friendly_commitment_layers,
    );
    tempvar log_expected_input_degree = sum_of_step_sizes + config.log_last_layer_degree_bound;
    assert log_expected_input_degree + log_n_cosets = config.log_input_size;
    return (log_expected_degree=log_expected_input_degree);
}

func fri_layers_config_validate{range_check_ptr}(
    n_layers: felt,
    layers: TableCommitmentConfig*,
    fri_step_sizes: felt*,
    log_input_size: felt,
    n_verifier_friendly_commitment_layers: felt,
) -> (sum_of_step_sizes: felt) {
    alloc_locals;
    if (n_layers == 0) {
        assert_nn(log_input_size);
        return (sum_of_step_sizes=0);
    }

    local fri_step = fri_step_sizes[0];
    assert_in_range(fri_step, 1, MAX_FRI_STEP + 1);
    let (sum_of_step_sizes) = fri_layers_config_validate(
        n_layers=n_layers - 1,
        layers=&layers[1],
        fri_step_sizes=&fri_step_sizes[1],
        log_input_size=log_input_size - fri_step,
        n_verifier_friendly_commitment_layers=n_verifier_friendly_commitment_layers,
    );
    let (n_columns) = pow(2, fri_step);
    assert layers[0].n_columns = n_columns;
    validate_vector_commitment(
        config=layers[0].vector,
        expected_height=log_input_size - fri_step,
        n_verifier_friendly_commitment_layers=n_verifier_friendly_commitment_layers,
    );
    return (sum_of_step_sizes=sum_of_step_sizes + fri_step);
}

from starkware.cairo.common.alloc import alloc
from starkware.cairo.common.cairo_builtins import BitwiseBuiltin, PoseidonBuiltin
from starkware.cairo.common.math import horner_eval
from starkware.cairo.common.pow import pow
from starkware.cairo.stark_verifier.core.channel import (
    Channel,
    ChannelSentFelt,
    ChannelUnsentFelt,
    random_felts_to_prover,
    read_felt_vector_from_prover,
)
from starkware.cairo.stark_verifier.core.fri.config import FriConfig, fri_config_validate
from starkware.cairo.stark_verifier.core.fri.fri_layer import (
    FriLayerComputationParams,
    FriLayerQuery,
    compute_next_layer,
    get_fri_group,
)
from starkware.cairo.stark_verifier.core.table_commitment import (
    TableCommitment,
    TableCommitmentConfig,
    TableCommitmentWitness,
    TableDecommitment,
    TableUnsentCommitment,
    table_commit,
    table_decommit,
)
from starkware.cairo.stark_verifier.core.utils import FIELD_GENERATOR

// A FRI phase with N layers starts with a single input layer.
// Afterwards, there are N - 1 inner layers resulting from FRI-folding each preceding layer.
// Each such layer has a separate table commitment, for a total of N - 1 commitments.
// Lastly, there is another FRI-folding resulting in the last FRI layer, that is commited by
// sending the polynomial coefficients, instead of a table commitment.
// Each folding has a step size.
// Illustration:
// InputLayer, no commitment.
//   fold step 0
// InnerLayer 0, Table commitment
//   fold step 1
// ...
// InnerLayer N - 2, Table commitment
//   fold step N - 1
// LastLayer, Polynomial coefficients
//
// N steps.
// N - 1 inner layers.

// Commitment values for FRI. Used to generate a commitment by "reading" these values
// from the channel.
struct FriUnsentCommitment {
    // Array of size n_layers - 1 containing unsent table commitments for each inner layer.
    inner_layers: TableUnsentCommitment*,
    // Array of size 2**log_last_layer_degree_bound containing coefficients for the last layer
    // polynomial.
    last_layer_coefficients: ChannelUnsentFelt*,
}

struct FriCommitment {
    config: FriConfig*,
    // Array of size n_layers - 1 containing table commitments for each inner layer.
    inner_layers: TableCommitment**,
    // Array of size n_layers, of one evaluation point for each layer.
    eval_points: felt*,
    // Array of size 2**log_last_layer_degree_bound containing coefficients for the last layer
    // polynomial.
    last_layer_coefficients: ChannelSentFelt*,
}

struct FriDecommitment {
    // Number of queries.
    n_values: felt,
    // Array of size n_values, containing the values of the input layer at query indices.
    values: felt*,
    // Array of size n_values, containing the field elements that correspond to the query indices
    // (See queries_to_points).
    points: felt*,
}

// A witness for the decommitment of the FRI layers over queries.
struct FriWitness {
    // An array of size n_layers - 1, containing a witness for each inner layer.
    layers: FriLayerWitness*,
}

// A witness for a single FRI layer. This witness is required to verify the transition from an
// inner layer to the following layer.
struct FriLayerWitness {
    // Values for the sibling leaves required for decommitment.
    n_leaves: felt,
    leaves: felt*,
    // Table commitment witnesses for decommiting all the leaves.
    table_witness: TableCommitmentWitness*,
}

// Commit function of the FRI component.
// Implements the commit phase of the FRI protocol.
func fri_commit{poseidon_ptr: PoseidonBuiltin*, channel: Channel, range_check_ptr}(
    unsent_commitment: FriUnsentCommitment*, config: FriConfig*
) -> (commitment: FriCommitment*) {
    alloc_locals;
    let (inner_layer_commitments: TableCommitment**) = alloc();
    let (eval_points: felt*) = alloc();

    // The first step should be 0, and thus we don't need a point for it.
    assert config.fri_step_sizes[0] = 0;
    assert eval_points[0] = 0;

    // Read inner layer commitments and eval_points.
    fri_commit_rounds(
        n_layers=config.n_layers - 1,
        configs=config.inner_layers,
        unsent_commitments=unsent_commitment.inner_layers,
        step_sizes=config.fri_step_sizes,
        commitments=inner_layer_commitments,
        eval_points=&eval_points[1],
    );

    // Read last layer coefficients.
    let (n_coefficients) = pow(2, config.log_last_layer_degree_bound);
    let (coefficients) = read_felt_vector_from_prover(
        n_values=n_coefficients, values=unsent_commitment.last_layer_coefficients
    );

    return (
        commitment=new FriCommitment(
            config=config,
            inner_layers=inner_layer_commitments,
            eval_points=eval_points,
            last_layer_coefficients=coefficients,
        ),
    );
}

// Performs FRI commitment phase rounds. Each round reads a commitment on a layer, and sends an
// evaluation point for the next round.
func fri_commit_rounds{poseidon_ptr: PoseidonBuiltin*, channel: Channel, range_check_ptr}(
    n_layers: felt,
    configs: TableCommitmentConfig*,
    unsent_commitments: TableUnsentCommitment*,
    step_sizes: felt*,
    commitments: TableCommitment**,
    eval_points: felt*,
) {
    alloc_locals;
    if (n_layers == 0) {
        return ();
    }

    // Read commitments.
    let (table_commitment) = table_commit(unsent_commitment=unsent_commitments[0], config=configs);
    assert commitments[0] = table_commitment;

    // Send the next eval_points.
    random_felts_to_prover(n_elements=1, elements=eval_points);

    return fri_commit_rounds(
        n_layers=n_layers - 1,
        configs=&configs[1],
        unsent_commitments=&unsent_commitments[1],
        step_sizes=&step_sizes[1],
        commitments=&commitments[1],
        eval_points=&eval_points[1],
    );
}

// FRI protocol component decommitment.
func fri_decommit{
    range_check_ptr,
    blake2s_ptr: felt*,
    bitwise_ptr: BitwiseBuiltin*,
    poseidon_ptr: PoseidonBuiltin*,
}(
    n_queries: felt,
    queries: felt*,
    commitment: FriCommitment*,
    decommitment: FriDecommitment*,
    witness: FriWitness*,
) {
    alloc_locals;

    assert n_queries = decommitment.n_values;
    let fri_first_layer_evaluations = decommitment.values;

    // Compute first FRI layer queries.
    let (fri_queries: FriLayerQuery*) = alloc();
    gather_first_layer_queries(
        n_queries=n_queries,
        queries=queries,
        evaluations=decommitment.values,
        x_values=decommitment.points,
        fri_queries=fri_queries,
    );

    // Compute fri_group.
    let (fri_group) = get_fri_group();

    // Decommit inner layers.
    let (n_last_queries, last_queries) = fri_decommit_layers(
        fri_group=fri_group,
        n_layers=commitment.config.n_layers - 1,
        commitment=commitment.inner_layers,
        layer_witness=witness.layers,
        eval_points=&commitment.eval_points[1],
        step_sizes=&commitment.config.fri_step_sizes[1],
        n_queries=n_queries,
        queries=fri_queries,
    );

    // Last layer.
    let (n_coefficients) = pow(2, commitment.config.log_last_layer_degree_bound);
    verify_last_layer(
        n_queries=n_last_queries,
        queries=last_queries,
        n_coefficients=n_coefficients,
        coefficients=commitment.last_layer_coefficients,
    );
    return ();
}

func gather_first_layer_queries(
    n_queries: felt,
    queries: felt*,
    evaluations: felt*,
    x_values: felt*,
    fri_queries: FriLayerQuery*,
) {
    if (n_queries == 0) {
        return ();
    }

    // Translate the coset to the homogenous group to have simple FRI equations.
    let shifted_x_value = x_values[0] / FIELD_GENERATOR;
    assert fri_queries[0] = FriLayerQuery(
        index=queries[0], y_value=evaluations[0], x_inv_value=1 / shifted_x_value
    );

    return gather_first_layer_queries(
        n_queries=n_queries - 1,
        queries=&queries[1],
        evaluations=&evaluations[1],
        x_values=&x_values[1],
        fri_queries=&fri_queries[1],
    );
}

func fri_decommit_layers{
    range_check_ptr,
    blake2s_ptr: felt*,
    bitwise_ptr: BitwiseBuiltin*,
    poseidon_ptr: PoseidonBuiltin*,
}(
    fri_group: felt*,
    n_layers: felt,
    commitment: TableCommitment**,
    layer_witness: FriLayerWitness*,
    eval_points: felt*,
    step_sizes: felt*,
    n_queries: felt,
    queries: FriLayerQuery*,
) -> (n_last_queries: felt, last_queries: FriLayerQuery*) {
    if (n_layers == 0) {
        return (n_last_queries=n_queries, last_queries=queries);
    }

    alloc_locals;
    // Params.
    let (coset_size) = pow(2, step_sizes[0]);
    tempvar params: FriLayerComputationParams* = new FriLayerComputationParams(
        coset_size=coset_size, fri_group=fri_group, eval_point=eval_points[0]
    );

    // Allocate values for the next layer computation.
    let (next_queries: FriLayerQuery*) = alloc();
    let next_queries_start = next_queries;
    let sibling_witness = layer_witness.leaves;
    let (verify_indices) = alloc();
    let verify_indices_start = verify_indices;
    let (verify_y_values) = alloc();
    let verify_y_values_start = verify_y_values;

    // Compute next layer queries.
    with n_queries, queries, sibling_witness, next_queries, verify_indices, verify_y_values {
        compute_next_layer(params=params);
    }
    let n_next_queries = (next_queries - next_queries_start) / FriLayerQuery.SIZE;

    // Table decommitment.
    tempvar decommitment: TableDecommitment* = new TableDecommitment(
        n_values=verify_y_values - verify_y_values_start, values=verify_y_values_start
    );
    table_decommit(
        commitment=commitment[0],
        n_queries=verify_indices - verify_indices_start,
        queries=verify_indices_start,
        decommitment=decommitment,
        witness=layer_witness.table_witness,
    );

    return fri_decommit_layers(
        fri_group=fri_group,
        n_layers=n_layers - 1,
        commitment=&commitment[1],
        layer_witness=&layer_witness[1],
        eval_points=&eval_points[1],
        step_sizes=&step_sizes[1],
        n_queries=n_next_queries,
        queries=next_queries_start,
    );
}

// Verifies FRI last layer by evaluating the given polynomial on the given points (=inverses of
// x_inv_values), and comparing the results to the given values.
func verify_last_layer(
    n_queries: felt, queries: FriLayerQuery*, n_coefficients: felt, coefficients: felt*
) {
    if (n_queries == 0) {
        return ();
    }

    let (value) = horner_eval(
        n_coefficients=n_coefficients, coefficients=coefficients, point=1 / queries[0].x_inv_value
    );
    assert value = queries[0].y_value;

    return verify_last_layer(
        n_queries=n_queries - 1,
        queries=&queries[1],
        n_coefficients=n_coefficients,
        coefficients=coefficients,
    );
}

// Primitive roots of unity of orders 2, 4, 8 and 16.
// Use 1 / 3^((PRIME - 1) / 16) as the primitive root of order 16 (3 is a generator of the
// multiplicative group of the field).
const OMEGA_16 = 0x5c3ed0c6f6ac6dd647c9ba3e4721c1eb14011ea3d174c52d7981c5b8145aa75;
const OMEGA_8 = OMEGA_16 * OMEGA_16;
const OMEGA_4 = OMEGA_8 * OMEGA_8;
const OMEGA_2 = OMEGA_4 * OMEGA_4;

// Folds 2 elements into one using one layer of FRI.
func fri_formula2(f_x, f_minus_x, eval_point, x_inv) -> (res: felt) {
    return (res=f_x + f_minus_x + eval_point * x_inv * (f_x - f_minus_x));
}

// Folds 4 elements into one using 2 layers of FRI.
func fri_formula4(values: felt*, eval_point, x_inv) -> (res: felt) {
    // First layer.
    let (g0) = fri_formula2(f_x=values[0], f_minus_x=values[1], eval_point=eval_point, x_inv=x_inv);
    let (g1) = fri_formula2(
        f_x=values[2], f_minus_x=values[3], eval_point=eval_point, x_inv=x_inv * OMEGA_4
    );

    // Second layer.
    return fri_formula2(
        f_x=g0, f_minus_x=g1, eval_point=eval_point * eval_point, x_inv=x_inv * x_inv
    );
}

// Folds 8 elements into one using 3 layers of FRI.
func fri_formula8(values: felt*, eval_point, x_inv) -> (res: felt) {
    // First two layers.
    let (g0) = fri_formula4(values=values, eval_point=eval_point, x_inv=x_inv);
    let (g1) = fri_formula4(values=&values[4], eval_point=eval_point, x_inv=x_inv * OMEGA_8);

    // Last layer.
    tempvar eval_point2 = eval_point * eval_point;
    let eval_point4 = eval_point2 * eval_point2;

    tempvar x_inv2 = x_inv * x_inv;
    let x_inv4 = x_inv2 * x_inv2;
    return fri_formula2(f_x=g0, f_minus_x=g1, eval_point=eval_point4, x_inv=x_inv4);
}

// Folds 16 elements into one using 4 layers of FRI.
func fri_formula16(values: felt*, eval_point, x_inv) -> (res: felt) {
    // First three layers.
    let (g0) = fri_formula8(values=values, eval_point=eval_point, x_inv=x_inv);
    let (g1) = fri_formula8(values=&values[8], eval_point=eval_point, x_inv=x_inv * OMEGA_16);

    // Last layer.
    tempvar eval_point2 = eval_point * eval_point;
    tempvar eval_point4 = eval_point2 * eval_point2;
    let eval_point8 = eval_point4 * eval_point4;

    tempvar x_inv2 = x_inv * x_inv;
    tempvar x_inv4 = x_inv2 * x_inv2;
    let x_inv8 = x_inv4 * x_inv4;

    return fri_formula2(f_x=g0, f_minus_x=g1, eval_point=eval_point8, x_inv=x_inv8);
}

// Folds 'coset_size' elements into one using log2(coset_size) layers of FRI.
// 'coset_size' can be 2, 4, 8, or 16.
func fri_formula(values: felt*, eval_point, x_inv, coset_size) -> (res: felt) {
    // Sort by usage frequency.
    if (coset_size == 8) {
        return fri_formula8(values, eval_point, x_inv);
    }
    if (coset_size == 4) {
        return fri_formula4(values, eval_point, x_inv);
    }
    if (coset_size == 16) {
        return fri_formula16(values, eval_point, x_inv);
    }
    if (coset_size == 2) {
        return fri_formula2(values[0], values[1], eval_point, x_inv);
    }

    // Fail.
    assert 1 = 0;
    return (res=0);
}

from starkware.cairo.common.alloc import alloc
from starkware.cairo.common.math import assert_nn, assert_not_equal
from starkware.cairo.common.pow import pow
from starkware.cairo.common.registers import get_label_location
from starkware.cairo.stark_verifier.core.fri.fri_formula import fri_formula

// Constant parameters for computing the next FRI layer.
struct FriLayerComputationParams {
    coset_size: felt,
    fri_group: felt*,
    eval_point: felt,
}

struct FriLayerQuery {
    index: felt,
    y_value: felt,
    x_inv_value: felt,
}

// Computes the elements of the coset starting at coset_start_index.
//
// Inputs:
//   - n_queries: the number of input queries.
//   - queries: an iterator over the input queries.
//   - sibling_witness: a list of all the query's siblings.
//   - coset_size: the number of elements in the coset.
//   - coset_start_index: the index of the first element of the coset being calculated.
//   - offset_within_coset: the offset of the current processed element within the coset.
//   - fri_group: holds the group <g> in bit reversed order, where g is the generator of the coset.
//
// Outputs:
//   - coset_elements: the values of the coset elements.
//   - coset_x_inv: x_inv of the first element in the coset. This value is set only if at least one
//   query was consumed by this function.
func compute_coset_elements{n_queries: felt, queries: FriLayerQuery*, sibling_witness: felt*}(
    coset_size: felt,
    coset_start_index: felt,
    offset_within_coset: felt,
    fri_group: felt*,
    coset_elements: felt*,
    coset_x_inv: felt*,
) {
    if (offset_within_coset == coset_size) {
        return ();
    }

    if (n_queries != 0) {
        if (queries.index == coset_start_index + offset_within_coset) {
            assert [coset_elements] = queries.y_value;
            assert [coset_x_inv] = queries.x_inv_value * [fri_group];

            let n_queries = n_queries - 1;
            let queries = &queries[1];
            return compute_coset_elements(
                coset_size=coset_size,
                coset_start_index=coset_start_index,
                offset_within_coset=offset_within_coset + 1,
                fri_group=&fri_group[1],
                coset_elements=&coset_elements[1],
                coset_x_inv=coset_x_inv,
            );
        }
    }

    assert [coset_elements] = [sibling_witness];
    let sibling_witness = &sibling_witness[1];
    return compute_coset_elements(
        coset_size=coset_size,
        coset_start_index=coset_start_index,
        offset_within_coset=offset_within_coset + 1,
        fri_group=&fri_group[1],
        coset_elements=&coset_elements[1],
        coset_x_inv=coset_x_inv,
    );
}

// Computes FRI next layer for the given queries. I.e., takes the given i-th layer queries
// and produces queries for layer i+1 (a single query for each coset in the i-th layer).
//
// Inputs:
//   - n_queries: the number of input queries.
//   - queries: input queries.
//   - sibling_witness: a list of all the query's siblings.
//   - params: the parameters to use for the layer computation.
//
// Outputs:
//   - next_queries: queries for the next layer.
//   - verify_indices: query indices of the given layer for Merkle verification.
//   - verify_y_values: query y values of the given layer for Merkle verification.
func compute_next_layer{
    range_check_ptr,
    n_queries: felt,
    queries: FriLayerQuery*,
    sibling_witness: felt*,
    next_queries: FriLayerQuery*,
    verify_indices: felt*,
    verify_y_values: felt*,
}(params: FriLayerComputationParams*) {
    if (n_queries == 0) {
        return ();
    }

    alloc_locals;
    local coset_size = params.coset_size;

    // Guess coset_index.
    // Note that compute_coset_elements() consumes queries, and it is verified
    // that it consumed at least one query. This will imply that coset_index is correct.
    local coset_index = nondet %{ ids.queries.index // ids.params.coset_size %};
    assert_nn(coset_index);

    // Write verification query.
    assert [verify_indices] = coset_index;
    let verify_indices = &verify_indices[1];
    let coset_elements = verify_y_values;
    let verify_y_values = &verify_y_values[coset_size];

    // Store n_queries in order to verify at least one query was consumed.
    local n_queries_before = n_queries;
    let (coset_x_inv: felt*) = alloc();
    compute_coset_elements(
        coset_size=coset_size,
        coset_start_index=coset_index * coset_size,
        offset_within_coset=0,
        fri_group=params.fri_group,
        coset_elements=coset_elements,
        coset_x_inv=coset_x_inv,
    );

    // Verify that at least one query was consumed.
    assert_not_equal(n_queries_before, n_queries);

    let (fri_formula_res) = fri_formula(
        values=coset_elements,
        eval_point=params.eval_point,
        x_inv=[coset_x_inv],
        coset_size=coset_size,
    );

    // Write next layer query.
    let (next_x_inv) = pow([coset_x_inv], params.coset_size);
    assert next_queries[0] = FriLayerQuery(
        index=coset_index, y_value=fri_formula_res, x_inv_value=next_x_inv
    );
    let next_queries = &next_queries[1];

    return compute_next_layer(params=params);
}

// Returns the elements of the multiplicative subgroup of order 16, in bit-reversed order for the
// cairo prime field. Note that the first 2^k elements correspond to the group of size 2^k.
func get_fri_group() -> (address: felt*) {
    alloc_locals;
    let (address) = get_label_location(data);
    return (address=address);

    data:
    dw 0x1;
    dw 0x800000000000011000000000000000000000000000000000000000000000000;
    dw 0x625023929a2995b533120664329f8c7c5268e56ac8320da2a616626f41337e3;
    dw 0x1dafdc6d65d66b5accedf99bcd607383ad971a9537cdf25d59e99d90becc81e;
    dw 0x63365fe0de874d9c90adb1e2f9c676e98c62155e4412e873ada5e1dee6feebb;
    dw 0x1cc9a01f2178b3736f524e1d06398916739deaa1bbed178c525a1e211901146;
    dw 0x3b912c31d6a226e4a15988c6b7ec1915474043aac68553537192090b43635cd;
    dw 0x446ed3ce295dda2b5ea677394813e6eab8bfbc55397aacac8e6df6f4bc9ca34;
    dw 0x5ec467b88826aba4537602d514425f3b0bdf467bbf302458337c45f6021e539;
    dw 0x213b984777d9556bac89fd2aebbda0c4f420b98440cfdba7cc83ba09fde1ac8;
    dw 0x5ce3fa16c35cb4da537753675ca3276ead24059dddea2ca47c36587e5a538d1;
    dw 0x231c05e93ca34c35ac88ac98a35cd89152dbfa622215d35b83c9a781a5ac730;
    dw 0x00b54759e8c46e1258dc80f091e6f3be387888015452ce5f0ca09ce9e571f52;
