%builtins output poseidon

from starkware.cairo.common.alloc import alloc
from starkware.cairo.common.cairo_builtins import PoseidonBuiltin
from starkware.cairo.common.memcpy import memcpy
from starkware.cairo.common.serialize import serialize_word
from starkware.cairo.stark_verifier.core.stark import StarkProof

// Adds extra Cairo steps to the mock verifier to simulate running the STARK verifier.
//
// Arguments:
// n_mock_steps - number of steps to grind.
func grind_mock_steps(n_mock_steps: felt) {
    if (n_mock_steps == 0) {
        return ();
    }
    return grind_mock_steps(n_mock_steps=n_mock_steps - 4);
}

// Mock Cairo verifier - grind steps instead of verifing proofs.
//
// Arguments:
// program_hash - Hash of the simple bootloader program.
// output_len - length of the output.
// output - list of output words.
// stark_proof - Pointer to StarkProof struct.
//
// Hint arguments:
// n_mock_steps - Approximate number of Cairo steps of Cairo verifier.
func verify_cairo_proof(
    program_hash: felt, output_len: felt, output: felt*, stark_proof: StarkProof*
) {
    grind_mock_steps(n_mock_steps=nondet %{ n_steps %});
    return ();
}

// Mock function for the Cairo verifier.
//
// Hint arguments:
// program_input - Contains the inputs for the mock Cairo verifier.
//
// Outputs the program hash and the hash of the output.
func main{output_ptr: felt*, poseidon_ptr: PoseidonBuiltin*}() {
    alloc_locals;
    // Init an `output` arr and fill it with the output of the program we mock-verify.
    local output: felt*;
    let (stark_proof: StarkProof*) = alloc();
    %{
        from starkware.cairo.cairo_verifier.mock_cairo_verifier_input import MockCairoVerifierInput

        # Get output to apply hash state.
        mock_cairo_verifier_input = MockCairoVerifierInput.load(program_input)
        program_hash = mock_cairo_verifier_input.program_hash
        program_output = mock_cairo_verifier_input.program_output
        ids.output = segments.gen_arg(program_output)
    %}
    local output_len = nondet %{ len(program_output) %};
    local program_hash = nondet %{ program_hash %};

    // Verify Cairo proof.
    %{ n_steps = program_input["n_steps"] %}
    verify_cairo_proof(
        program_hash=program_hash, output_len=output_len, output=output, stark_proof=stark_proof
    );
    // Write program hash to output.
    assert [output_ptr] = program_hash;
    let output_ptr = output_ptr + 1;
    // Dump the output without any special processing.
    memcpy(dst=output_ptr, src=output, len=output_len);
    let output_ptr = output_ptr + output_len;

    return ();
}
